    /**
     * Gets the attribute value for the calculated attribute TransGroupName.
     * @return the TransGroupName
     */
    public String getTransGroupName() {

        String group = getItmGrp();
        System.out.println("group = " + group);
        if (group != null) {
            FARegisterAMImpl am = (FARegisterAMImpl) this.getApplicationModule();
            ViewObjectImpl grp = am.getLovGrp1();
            grp.setNamedWhereClauseParam("BindCldId", EbizParams.GLBL_APP_CLD_ID());
            grp.setNamedWhereClauseParam("BindCntryId", ADFModelUtils.resolvEl("#{pageFlowScope.GLBL_CNTRY_PRF_ID}"));
            grp.setNamedWhereClauseParam("BindGrpId", group);
            grp.setNamedWhereClauseParam("BindGrpIdDisp", group);
            grp.setNamedWhereClauseParam("BindHoOrgId", EbizParams.GLBL_HO_ORG_ID());
            grp.setNamedWhereClauseParam("BindOrgId", EbizParams.GLBL_APP_USR_ORG());
            grp.setNamedWhereClauseParam("BindSlocId", EbizParams.GLBL_APP_SERV_LOC());
            grp.executeQuery();
            Row[] allRowsInRange = grp.getAllRowsInRange();
            System.out.println("allRowsInRange = " + allRowsInRange);
            if (allRowsInRange.length > 0) {
                Object GroupName = allRowsInRange[0].getAttribute("GroupName");
                System.out.println("GroupName = " + GroupName);
                if (GroupName != null) {
                    return GroupName.toString();
                }
            }
        }
        return (String) getAttributeInternal(TRANSGROUPNAME);
    }

